String.prototype.endWith=function(t){var e=this.length-t.length;return 0<=e&&this.lastIndexOf(t)==e};var isImage=function(t){return t&&t.src&&(t.src.endsWith(".jpg")||t.src.endsWith(".jpeg")||t.src.endsWith(".png"))},result=Object.values(document.getElementsByTagName("img")).filter(isImage).map(t=>{return{src:t.getAttribute("data-original"),title:t.title}});console.log(result);